INSERT INTO `anime` (`anime_id`, `titulo`, `descricao`, `capa`, `qt_ep`, `data_lanc`) VALUES
	(1, 'Kono Subarashii Sekai ni Shukufuku Wo!', 'Após um acidente de trânsito, a breve e desapontadora vida de Kazuma Sato deveria ter acabado, mas ele acorda e vê uma belíssima garota diante dele. Ela diz ser Aqua, uma deusa, e lhe pergunta se ele gostaria de ir para outro mundo, levando consigo apenas uma coisa deste mundo. Kazuma decide levar a própria deusa consigo, e eles são transportados para um mundo de fantasia cheio de aventura, dominado por um rei-demônio. Agora Kazuma quer apenas viver em paz, mas Aqua quer resolver vários dos problemas deste novo mundo, e o rei-demônio não vai ignorá-los por muito tempo...', _binary , 12, '2016-01-14'),
	(2, 'Tsue To Tsurugi no Wistoria', 'Um garoto esforçado chamado Will entra em uma academia de magia na esperança de se tornar um grande feiticeiro. Infelizmente, há uma falha fatal em seu plano: ele não tem a habilidade de usar magia. Em meio aos olhares frios de seus colegas de classe e instrutores, Will se sente desencorajado às vezes, mas ele continua avançando com uma determinação inabalável. Ele não pode usar uma varinha, mas pode empunhar uma espada em sua batalha para alcançar o topo de um mundo dominado pela magia! Ele só precisa acreditar em suas próprias forças únicas e se lembrar da promessa que fez a alguém muito precioso para ele…', _binary , 12, '2024-07-07'),
	(3, 'Tokidoki Bosotto Russia-go de Dereru Tonari no Alya-san', 'Alya é uma aluna transferida bastante popular em sua nova escola, frequentemente exibindo uma atitude fria enquanto tira notas altas. Ela ignora seu colega nerd, Kuze Masachika, exceto quando solta algumas frases de flerte em russo para ele. Mal sabe ela que Kuze entende russo, embora finja que não. Vamos ver até onde essa história de amor maluca os levará!', _binary , 12, '2024-07-03'),
	(5, '2.5-Jigen no Ririsa', '“Eu não tenho interesse em garotas de verdade!” Afirma Okumura, o presidente do clube de mangá da escola. Ele é o típico otaku, obcecado por uma personagem de mangá 2D sexy (fictícia) conhecido como Liliel. Então o novo ano escolar começa, e uma garota 3D (real!) chamada Lilysa cuja paixão é cosplay se junta ao clube. Lilysa convence Okumura a se tornar seu fotógrafo e adivinha quem é seu personagem de mangá favorito? Não só isso, mas Lilysa gosta de modelar poses fetichistas! Os limites entre 2D e 3D começam a se confundir à medida que esta comédia romântica de sangue quente se desenrola.', _binary , 24, '2024-07-05'),
	(6, 'Overlord', 'Overlord Todos os Episodios Online, Assistir Overlord Anime Completo, Assistir Overlord Online.\r\nUm homem decide não deslogar quando um VRMMORPG antigo é fechado e como consequência ele é transportado para o jogo. Com apenas ele ali e sem uma família para se preocupar ele começa a tentar dominar o mundo do jogo, aonde os NPCs estão mudando pouco a pouco e começando a sentir emoções humanas.', _binary , 13, '2015-09-29'),
	(7, 'One Piece', 'One Piece Todos os Episodios Online, Assistir One Piece Anime Completo, Assistir One Piece Online.\r\nHouve um homem que conquistou tudo aquilo que o mundo tinha a oferecer, o lendário Rei dos Piratas, Gold Roger. Capturado e condenado à execução pelo Governo Mundial, suas últimas palavras lançaram legiões aos mares. “Meu tesouro? Se quiserem, podem pegá-lo. Procurem-no! Ele contém tudo que este mundo pode oferecer!”. Foi a revelação do maior tesouro, o One Piece, cobiçado por homens de todo o mundo, sonhando com fama e riqueza imensuráveis… Assim começou a Grande Era dos Piratas!', _binary , 1121, '1999-10-20'),
	(8, 'Fullmetal Alchemist: Brotherhood', 'Depois de perderem sua mãe, Alphonse e Edward Elric tentam trazê-la de volta usando uma técnica de alquimia proíbida. Contudo, o princípio básico da alquimia é a ‘troca equivalente’, e tentar ressucitar alguém custa muito alto. Ed perde sua perna, e Al perde seu corpo. Ed consegue selar a alma de Al dentro de uma grande armadura metálica, dando em troca seu braço. Anos depois, Ed (com dois membros de metal) e Al (ainda preso na armadura) deixam a sua cidade natal.Ed, que possui um talento nato para a alquimia, se torna um alquimista com certificado nacional, e logo passa a ser chamado de ‘full metal alchemist’. Mas o verdadeiro objetivo dos irmãos é encontrar a pedra filosofal, na esperança de recuperarem os seus corpos originais. Logo eles descobrem que essa mística pedra, que pode nem existir, é visada não só por eles, mas como muitas outras pessoas também.', _binary , 64, '2009-04-05'),
	(9, 'JoJo no Kimyou na Bouken', 'A família Joestar inicia o confronto final com seu eterno inimigo, Dio Brando, um poderoso e perigoso vampiro cujo corpo, do pescoço para baixo, pertence ao primeiro Joestar a enfrentá-lo. O vampiro havia sido derrotado e estava em sono profundo num caixão no fundo do oceano, mas foi resgatado e libertado por marinheiros, que pagaram este erro com a vida.', _binary , 12, '2024-07-07'),
	(10, 'JoJo no Kimyou na Bouken Part 5: Ougon no Kaze', 'Ambientado em 2001 na Itália, a história segue Giorno Giovanna e seu sonho de crescer dentro da máfia napolitana e derrotar o chefe da Passione, a mais poderosa e influente gangue, afim de se tornar uma “Gang-Star”. Com a ajuda de um capo (chefe) e seus homens, ele se propõe a cumprir sua meta de absolver a máfia de sua corrupção.', _binary , 12, '2024-07-07'),
	(11, 'Kono Subarashii Sekai ni Shukufuku wo! 2', 'Um garoto esforçado chamado Will entra em uma academia de magia na esperança de se tornar um grande feiticeiro. Infelizmente, há uma falha fatal em seu plano: ele não tem a habilidade de usar magia. Em meio aos olhares frios de seus colegas de classe e instrutores, Will se sente desencorajado às vezes, mas ele continua avançando com uma determinação inabalável. Ele não pode usar uma varinha, mas pode empunhar uma espada em sua batalha para alcançar o topo de um mundo dominado pela magia! Ele só precisa acreditar em suas próprias forças únicas e se lembrar da promessa que fez a alguém muito precioso para ele…', _binary , 10, '2017-01-12'),
	(12, 'Jujutsu Kaisen', 'Jujutsu Kaisen Yuji é um gênio do atletismo, mas não tem interesse algum em ficar correndo em círculos. Ele é feliz como membro no Clube de Estudo de Fenômenos Psíquicos. Apesar de estar no clube apenas por diversão, tudo fica sério quando um espírito de verdade aparece na escola! A vida está prestes a se tornar muito interessante na Escola Sugisawa…', _binary , 24, '2020-10-03'),
	(13, 'Megami no Café Terrace', 'A história acompanha Kasukabe Hayato, um jovem universitário que decide voltar para sua cidade natal ao descobrir que sua avó morreu. Ao chegar na loja da família, Hayato descobre que 5 belas garotas assumiram o café e se consideram como parte da família de sua avó. Tendo então que conviver junto delas, Hayato precisará aprender a lidar com suas diferentes personalidades enquanto tenta manter o café funcionando.', _binary , 12, '2023-04-08');
INSERT INTO `anime` (`anime_id`, `titulo`, `descricao`, `capa`, `qt_ep`, `data_lanc`) VALUES
	(14, 'Kimi no Koto ga Daidaidaidaidaisuki na 100-nin no Kanojo', 'Rentaro Aijo levou 100 foras ao longo do ensino fundamental. Então, ele visita um santuário e reza por melhor sorte no ensino médio. O Deus do Amor aparece para ele e lhe promete que em breve conhecerá 100 pessoas que está destinado a namorar. Mas há um problema: uma vez que o destino apresenta alguém a ele, os dois precisam se amar alegremente. Caso contrário, eles morrerão. O que acontecerá com Rentaro e suas 100 namoradas no ensino médio?', _binary , 12, '2023-10-08'),
	(15, 'Kage no Jitsuryokusha ni Naritakute!', 'Muitos admiram heróis e vilões, mas Cid Kagenou sempre desejou ser como aqueles que agem por entre as sombras das histórias. Percebendo que nunca seria capaz de conseguir atingir seus objetivo, Cid se surpreende ao se ver reencarnado em um mundo onde tem as capacidades necessárias para se tornar o que sempre admirou. A partir de então, ele cria uma falsa organização, com o objetivo de agir como um figurante qualquer, mas que trabalha por entrelinhas para confrontar um culto secreto que entrou em seu caminho.', _binary , 20, '2022-10-05'),
	(16, 'Ore wa Subete wo "Parry" suru: Gyaku Kanchigai no Sekai Saikyou wa Boukensha ni Naritai', 'O Reino de Clays enfrenta uma crise terrível: uma tentativa de assassinato foi feita contra a própria Princesa Lynneburg, e os países vizinhos observam as consequências como abutres famintos, planejando a queda do Reino. O conflito que se segue moldará o continente por séculos… mas Noor não faz a menor ideia de nada disso! Tendo acabado de chegar à capital real após mais de uma década de treinamento rigoroso e isolado em sua casa nas montanhas, ele está determinado a realizar seu sonho de infância de se tornar um aventureiro, mesmo que as únicas habilidades que possua sejam inúteis. Claro, ele pode “Parar” milhares de espadas em um único suspiro, mas todo mundo sabe que é preciso mais do que isso para ser um aventureiro! A jornada do nosso herói para realizar seu sonho será longa e árdua — mas se tem uma coisa que Noor não teme, é um bom e velho trabalho duro!\r\n\r\n', _binary , 12, '2024-07-05'),
	(17, 'Sword Art Online', 'Escapar é impossível até o jogo ser completado, um game over significa uma verdadeira morte. Sem saber a verdade da misteriosa nova geração do RPG, Sword Art Online, aproximadamente 10 mil jogadores logaram juntos, abrindo as cortinas para essa cruel batalha mortal. Jogando sozinho, o protagonista Kirito imediatamente aceitou a verdade desse RPG, e no mundo do jogo, em um castelo flutuante gigante chamado Aincrad, ele se distinguiu como um jogador solitário. Buscando completar o jogo alcançando o andar mais alto, Kirito arriscadamente continua sozinho. Por causa de um convite agressivo de uma guerreira e especialista em esgrima, Asuna, ele se juntou a ela. Esse encontro trouxe uma oportunidade para chamar pelo destinado Kirito.', _binary , 25, '2012-07-08'),
	(18, 'Sword Art Online: Alicization ', 'O Tradutor de Alma é uma interface de imersão total de última geração que interage com o Fluctlight do usuário—o equivalente tecnológico de uma alma humana—e difere fundamentalmente do método ortodoxo de enviar sinais ao cérebro. O instituto privado Rath busca aperfeiçoar sua criação contando com a ajuda de Kazuto Kirigaya, sobrevivente de Sword Art Online. Ele trabalha lá como funcionário em meio período para testar as capacidades do sistema no Submundo: o reino fantástico gerado pelo Tradutor de Alma. De acordo com o contrato de confidencialidade, qualquer memória criada pela máquina no mundo virtual é apagada ao retornar ao mundo real. Kazuto só consegue lembrar vagamente de um único nome, Alice, que provoca uma sensação de desconforto quando mencionado na realidade.', _binary , 24, '2018-10-07'),
	(19, 'Toradora!', 'Toradora Todos os Episodios Online, Assistir Toradora Anime Completo, assistir Toradora online.\r\nRyuuji Takasu é um jovem que vive com a vergonha de ser confundido por um delinquente por ter um olhar maligno herdado de seu pai mas, na verdade, ele é apenas um garoto educado com mania de limpeza. No primeiro dia de aula Ryuuji se encontra com a temida palmtop Taiga, uma garota baixinha e extremamente mau-humorada. Devido a uma confusão entre as bolsas na sala, Taiga coloca uma carta de amor por engano na bolsa de Ryuuji e, assim, ele descobre que ela está apaixonada pelo seu melhor amigo Yuusaku Kitamura. Da mesma forma, Taiga descobre que Ryuuji está apaixonado pela melhor amiga dela, Minori Kushieda. À medida que eles vão se conhecendo, eles viram amigos que ajudam um ao outro a alcançar seus objetivos que é o de declarar seu amor para seus respectivos melhores amigos.', _binary , 25, '2008-10-02'),
	(20, 'Zom 100: Zombie ni Naru made ni Shitai 100 no Koto', 'Em um apartamento cheio de lixo, Akira Tendo, de 24 anos, assiste a um filme de zumbi com olhos invejosos e sem vida. Depois de passar três anos difíceis em uma fábrica no Japão, seu espírito está quebrado. Ele não tem coragem nem de confessar seus sentimentos para Otori, sua linda colega de trabalho. Então, uma manhã, ele encontra o caseiro almoçando – que acaba sendo um zumbi! A cidade inteira está infestada de zumbis e, mesmo correndo para salvar sua vida, Akira nunca se sentiu tão vivo.', _binary , 12, '2023-07-09'),
	(21, 'Tsuki ga Michibiku Isekai Douchuu', 'A história acompanha Makoto Misumi, um jovem comum que é invocado em um mundo de fantasia para ser o grande herói que salvará as pessoas. Entretanto, quando a Deusa do lugar o vê, acaba o destituindo do título e o banindo para uma região deserta por achar o rosto do rapaz feio demais. Tendo adquirido grandes poderes nesse novo mundo, Makoto consegue sobreviver ao seu banimento e encontrar várias criaturas incríveis, como aranhas e dragões, formando assim alianças inesperadas para que possa remodelar o mundo em que os Deuses e humanos o abandonaram.', _binary , 12, '2021-07-07'),
	(22, 'Suki na Ko ga Megane wo Wasureta', 'Uma comédia romântica muito agradável sobre um garoto que só tem olhos para a garota que sempre esquece seus óculos! Com o novo ano escolar, chega uma nova sala de aula, novos colegas de classe e uma nova carteira para o tímido Komura. Mas qualquer apreensão que ele possa ter sentido se dissipa rapidamente quando ele avista Mie, que se senta ao seu lado. Com um hábito de deixar escapar silenciosamente as coisas mais aleatórias possíveis, a peculiar Mie usa óculos grossos que acentuam seus olhos adoráveis, fazendo o coração de Komura bater mais forte! Infelizmente, Mie é patologicamente esquecida e nunca consegue se lembrar de levar seus óculos para a aula! Mas nem tudo está perdido! Seu rosto franzino e malvado faz o coração de Komura disparar! Enquanto Komura está ansioso para ajudar e compartilhar seus livros com Mie, seu coração vai desistir da tensão quase diária de estar próximo de sua paixão?!', _binary , 13, '2023-07-04'),
	(23, 'Os Cavaleiros Do Zodíaco', 'Os 88 Cavaleiros de Atena trajam desde os tempos mitológicos armaduras protegidas pelas constelações do céu para, assim, servir sua deusa e preservar a paz e o amor na Terra. Agora, nos tempos modernos, nasce uma nova Atena e, para que ela não seja assassinada ainda bebê por aqueles que estão ofuscados pelo poder e pela ganância, ela é levada para longe, onde cresce como Saori Kido. Uma nova batalha santa está para começar! Vão, jovens Cavaleiros, protejam sua Atena!', _binary , 114, '2986-10-11'),
	(24, 'Boku no Hero Academia', 'Por toda a sua vida, Izuku sonhou ser um herói — um objetivo ambicioso para qualquer um, mas especialmente desafiador para um garoto sem superpoderes. Isso mesmo: em um mundo onde 80% da população tem algum tipo de Dom especial, Izuku teve a má sorte de nascer completamente normal. Mas isso não vai impedi-lo de se matricular em uma das academias de herois mais prestigiosas do mundo.', _binary , 13, '2016-04-03');
INSERT INTO `anime` (`anime_id`, `titulo`, `descricao`, `capa`, `qt_ep`, `data_lanc`) VALUES
	(25, 'Chainsaw Main', 'Denji tem um sonho simples – viver uma vida feliz e pacífica, passando um tempo com uma garota de quem gosta. Isso está muito longe da realidade, no entanto, já que Denji é forçado pela yakuza a matar demônios para pagar suas dívidas esmagadoras. Usando seu demônio de estimação Pochita como arma, ele está pronto para fazer qualquer coisa por um pouco de dinheiro.', _binary , 12, '2022-10-12'),
	(26, 'Kimetsu no Yaiba', 'Desde a morte de seu pai, o fardo de sustentar a família recaiu sobre os ombros de Tanjirou Kamado. Embora vivendo em pobreza em uma montanha remota, a família Kamado consegue desfrutar de uma vida relativamente pacífica e feliz. Um dia, Tanjirou decide descer até a vila local para ganhar um pouco de dinheiro vendendo carvão. No caminho de volta, a noite cai, forçando Tanjirou a se abrigar na casa de um homem estranho, que o alerta sobre a existência de demônios devoradores de carne que espreitam nas florestas à noite.', _binary , 26, '2019-04-06'),
	(27, 'Boushoku no Berserk', 'Fate é um guarda de castelo num mundo onde habilidades são tudo, e ele acabou conseguindo uma habilidade chamada “Gula”, cuja única serventia é deixá-lo com fome, fazendo com que Fate tenha uma vida miserável. Num certo dia, ele derrota alguns bandidos que estão se infiltrando no castelo, e seu mundo muda da água pro vinho. Assim começa a história de como um jovem, outrora ridicularizado como sem talento, começou a subir na vida!', _binary , 12, '2023-10-05'),
	(28, 'Chiyu Mahou no Machigatta Tsukaikata', 'Uma caminhada comum de volta para casa após a escola se transforma em uma jornada épica para Usato! Após ser subitamente transportado para outro mundo juntamente de dois colegas de classe, Usato descobre que foi convocado lá por acidente. No entanto, as coisas mudam de água pro vinho quando ele descobre que tem uma habilidade única para a magia de cura! Agora, ele treina além das limitações humanas, utilizando suas habilidades de autocura para ganhar uma força absurda e uma resistência incomparável.', _binary , 13, '2014-01-06'),
	(29, 'Engage Kiss', 'A história se passa em um mundo onde uma nova fonte de energia foi descoberta e a constante mineração dela criou um evento conhecido como “Desastre D”, onde criaturas demoníacas surgiram para traz o caos. O enredo acompanha Shuu, um jovem que trabalha para uma empresa militar na ilha artificial de Baylong City. Devido a sua falta de habilidade e seu péssimo hábito de gastar dinheiro, Shuu está sempre falido, fazendo com que Kisara, uma garota esforçada e capaz de fazer de tudo, se preocupe com ele o tempo todo. Além disso, sua antiga colega de trabalho e ex-namorada, Ayano, está sempre aparecendo para checar sua situação, fazendo com que os três estejam sempre se envolvendo em eventos inesperados em um mundo cheio de perigos.', _binary , 13, '2022-07-03'),
	(30, 'Fantasy Bishoujo Juniku Ojisan to', 'A história acompanha um homem de 32 anos e seu amigo que foram levados para um outro mundo. Por conta dos caprichos de uma deusa nudista, o amigo do protagonista foi transportado em seu corpo original, enquanto que ele foi colocado no corpo de uma bela garota. Agora, para recuperar seu corpo, o homem precisa se aventurar naquele novo mundo ao lado de seu amigo e derrotar o tão temível Rei Demônio enquanto tenta lidar com a estranha situação de comédia romântica que foi colocado.', _binary , 12, '2022-01-12'),
	(31, 'Horimiya', 'Embora seja admirada na escola por sua amabilidade e proeza acadêmica, a estudante Kyouko Hori esconde outro lado dela. Com os pais muitas vezes longe de casa devido ao trabalho, Hori tem que cuidar do irmão mais novo e fazer as tarefas domésticas, não deixando chance de socializar fora da escola. Enquanto isso, Izumi Miyamura é vista como um otaku taciturno de óculos. No entanto, na realidade, ele é uma pessoa gentil, incapaz de estudar. Além disso, ele tem nove piercings escondidos atrás de seu cabelo comprido e uma tatuagem nas costas e no ombro esquerdo. Por mero acaso, Hori e Miyamura se cruzam fora da escola – nenhum parecendo o que o outro esperava. Esses opostos aparentemente polares tornam-se amigos, compartilhando um com o outro um lado que nunca mostraram a ninguém.', _binary , 13, '2021-01-10'),
	(32, 'Kaguya-sama wa Kokurasetai: Tensai-tachi no Renai Zunousen', 'Considerado um gênio devido a ter as notas mais altas do país, Miyuki Shirogane lidera o prestigioso conselho estudantil da Academia Shuchiin como seu presidente, trabalhando ao lado do belo e rico vice-presidente Kaguya Shinomiya. Os dois são frequentemente considerados como o casal perfeito pelos alunos, apesar de não terem qualquer tipo de relacionamento romântico. No entanto, a verdade é que depois de passar tanto tempo juntos, os dois desenvolveram sentimentos um pelo outro; infelizmente, nenhum deles está disposto a confessar, pois isso seria um sinal de fraqueza. Com seu orgulho como estudantes de elite na linha, Miyuki e Kaguya embarcam em uma missão para fazer o que for necessário para obter uma confissão do outro. Através de suas travessuras diárias, a batalha do amor começa!', _binary , 12, '2019-01-12'),
	(33, 'Hellsing Ultimate', 'Existem criaturas das trevas e do mal que assolam a noite, devorando qualquer humano que tenha o azar de ser capturado por elas. Do outro lado está Hellsing, uma organização dedicada a destruir essas forças sobrenaturais que ameaçam a própria existência da humanidade. À sua frente está Integra Fairbrook Wingates Hellsing, que comanda um poderoso exército e dedica sua vida a lutar contra os mortos-vivos.', _binary , 10, '2006-02-10'),
	(34, 'Blue Lock', 'Depois de uma vergonhosa derrota na Copa do Mundo de 2018, a seleção japonesa de futebol decidiu que precisava encontrar um goleador com sede de vitória e capaz de virar jogos perdidos. Para isso, um programa foi criado com o objetivo de recrutar 300 jovens talentosos e brilhantes para passarem por um rígido treinamento, competindo entre si para decidir quem será o próximo capitão e atacante da seleção nacional.', _binary , 24, '2022-10-08'),
	(35, 'Shangri-La Frontier', 'Shangri-La Frontier A história acompanha Rakuro Hizutome, um jovem que tem como único interesse se desafiar jogando jogos ruins. Ele ouve falar sobre um novo VRMMMORPG chamado Shangri-La Frontier, e decide aplicar sua estratégia de sempre, ignorando o prólogo e pulando várias etapas de evolução. Mas será que as habilidades acima da média de Rakuro serão o bastante para descobrir todos os segredos de Shangri-La Frontier?', _binary , 25, '2023-10-01');
INSERT INTO `anime` (`anime_id`, `titulo`, `descricao`, `capa`, `qt_ep`, `data_lanc`) VALUES
	(36, 'Pokemon Jornadas', 'Em um novo dia na região de Kanto, Satoshi é convidado pelo Professor Yukinari Ookido para a cerimônia de inauguração do laboratório do Professor Sakuragi em Vermillion City. Durante o discurso cerimonial, o professor Sakuragi recebe um alerta de um Pokémon possivelmente raro aparecendo no porto de Vermillion City, levando Satoshi e os outros treinadores a correr para a área na esperança de encontrar o Pokémon misterioso. No porto, eles encontram Lugia – um Pokémon Lendário – em combate com outros treinadores.', _binary , 48, '2020-10-05'),
	(37, 'Animatrix', 'Animatrix é uma coleção de 9 contos de curta-metragem sobre o mundo de Matrix, em parte escrito pelos irmãos Wachowski. Os contos são uma fusão de computação gráfica com o tradicional anime japonês. A série trata das histórias que antecedem Matrix, dos dias finais das últimas cidades da humanidade, da guerra contra as máquinas e da queda da espécie humana.', _binary , 9, '2003-06-04'),
	(38, 'Bernard-jou Iwaku', 'A história é sobre o amor por famosas obras de literatura e segue Sawako \'Senhorita Bernard\' Machida, uma menina preguiçosa que quer ser uma pessoa bem informada através da leitura, mas que na verdade não lê muito. A história mostra as conversas entre \'Senhorita Bernard\' e seus amigos que são leitores ávidos sobre a Bíblia, Heike Monogatari, Armas, Germes e Aço, The Door Summer, The Great Passage, o Último Teorema de Fermat, e mais obras-primas que ela não necessariamente leu.', _binary , 10, '2016-12-01'),
	(39, 'Ashita No Joe', 'Dan e Julie logo se mudam para a cidade de Bayview onde ficaram amigos de Jake Vallory e Marucho gerencia o InterEspaço ao lado de um garoto chamado Ren Krawler. Subdamente, estranhos jogadores começam a aparecer, dentre eles uma garota chamada Fabia Sheen. Fabia revela que o InterEspaço Bakugan se tornou o palco de uma guerra estelar entre os planetas Neathia e Gandelian. Os Guerreiros então descobrem que Fabia é a princesa dos Neathianos enquanto Ren é um espião Gandeliano, e que agora fazem parte da guerra.', _binary , 79, '1970-06-04'),
	(40, 'Bakugan 3', 'Até onde você iria em busca de um sonho? Danpei Tange é um boxeador frustrado. Largou os ringues quando perdeu a visão de um dos olhos, e desistiu de ser treinador quando foi traído por seu discípulo. Desde então, vive uma vida de miséria, andando com mendigos e enchendo a cara o dia inteiro. Um dia, chega à cidade onde Tange mora um jovem. Violento, orgulhoso, aproveitador e mentiroso, Joe Yabuki arranja brigas, trapaceia, rouba e mente. No entanto, sua força e agilidade em suas brigas de rua despertam a atenção de Danpei, que vê em Joe o potencial para se tornar um grande boxeador, talvez até mesmo um campeão. É aí que começa Ashita no Joe, a saga de Joe Yabuki para deixar de ser um simples marginal e se tornar um grande campeão do boxe. De início a contragosto, Joe se recusa a treinar com Danpei, mas tudo muda quando entram em sua vida a bela Yoko Shiraki e o valente Rikiishi Tohru, aquele que se tornaria o grande rival de Joe até o fim da série.', _binary , 39, '2007-04-18'),
	(41, 'Wu Shan Wu Xing', 'Uma lenda conta que há muito tempo atrás, monstros podiam dar a habilidade de dominar os cinco elementos para certas autoridades escolhidas. Mas para isso, você tem que passar pelas perigosas montanhas do nevoeiro.', _binary , 3, '2020-07-26'),
	(42, 'Kawaii Dake ja Nai Shikimori-san', 'Surge a namorada mais arrasadora de todos os tempos! Izumi é um jovem naturalmente azarado que namora Shikimori, sua colega de classe. Shikimori é uma garota gentil com um lindo sorriso, e uma namorada carinhosa que é muito feliz ao lado de Izumi... Mas quando Izumi se mete em encrenca, Shikimori se torna uma galanteadora heroína que conquista os corações de todo mundo! Essa é a preciosa comédia romântica sobre Izumi e Shikimori, e sua divertida vida ao lado de seus amigos!', _binary , 12, '2022-04-10');
